alt-trans.target:
--journal | / journal : < Uri de journal/FriendlyName >
      Spécifiez un journal de résultats de test.  Par exemple, pour enregistrer les résultats dans un fichier trans (Visual Studio Test résultats.) utilisent /logger:trx.
      Pour publier les résultats des tests dans Team Foundation Server, utilisez TfsPublisher comme indiqué ci-dessous
      Exemple :, /logger:TfsPublisher ;
                Collection = < url de collection de projet équipe > ;
                BuildName = < nom de build > ;
                TeamProject = < nom du projet d’équipe >
                [; Plate-forme = < « Any CPU » par défaut >]
                [; Version = < « Debug » est par défaut >]
                [; RunTitle = < title >]
